import React from "react";
import { Grid, List, Image } from 'semantic-ui-react'

import { connect } from "react-redux";
import { fetchEvents, fetchUsers, fetchedEvents, loading } from "../redux/actions/index";

const PlayersList = (props) => {




  return(
    console.log(props),
    <List>
      <List.Item>
            <Image avatar src={props.currentUser.pic_url} />
            <List.Content>
           <List.Header as='a'>{props.name}</List.Header>
           <List.Description>
             'Organizer'
           </List.Description>
         </List.Content>
      </List.Item>
      <h1>Participants</h1>

    </List>
  )





}


const mapStateToProps = state => {
  let event = state.users.find(event => event.id === parseInt(propsFromParent.eventId))
  return {
    loading: state.loading,
    events: state.events,
    users: state.users
  };
};

export default connect(
  mapStateToProps,
  { fetchEvents, fetchUsers }
)(PlayersList);
